import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import React from 'react';


const Box = ({key},props)=> {

    return(
        <section className='box'>
            <div className="content">
                <FontAwesomeIcon
                    icon={props.icon}
                    className = "icon"
                />
                <h2>{props.title}</h2>
                <p>{props.body}</p>
            </div>
        </section>
    )

}


export default Box;
